import React from 'react';
import ReactDom from 'react-dom'
class App extends React.Component{
    render(){
        console.log(typeof (this.props.json))
        console.log(JSON.parse(this.props.json))
        let title = this.props.title;
        let {des} = this.props;
        return (
            <div>
            <Header></Header>
            <div>{this.props.json}</div>
            <div>{des}</div>
        </div>
        )
    }
}
class Header extends React.Component{
    render(){
        let {arr} =this.props;
        return <nav>
            <ul>
                <li>{arr[0]}</li>
                <li>{arr[1]}</li>
                <li>{arr[2]}</li>
            </ul>
        </nav>
    }

}
ReactDom.render(
    <App
     arr={['aa','bb','cc']}
    />,
    document.querySelector('#root'));
